import FooterGrop from "../molecules/footerGrop";
import TopButtonGroup from "../molecules/topButtonGroup";
import MainText from "../molecules/mainText";
const Main = () => {
    return(
        <div className='flex flex-col'>
            <TopButtonGroup />
            <MainText />
            <FooterGrop />
        </div>
    )
}
export default Main;
